window.win = {
  loopFun: function (t, r, a, e, i, o, n, s, c, h) {
    var u = s + n;
    if (r < 0 || r > 100) return alert("0-100");
    var f = Raphael(t, 2 * (s + n), 2 * (s + n));
    f.circle(u, u, s).attr({ "stroke-width": n, stroke: a }),
      (f.customAttributes.arc = function (t) {
        var r = -180,
          a = r + (360 * t) / 100,
          e = u,
          i = u,
          o = Math.PI / 180,
          n = e + s * Math.sin(-r * o),
          c = i + s * Math.cos(-r * o),
          h = e + s * Math.sin(-a * o),
          f = i + s * Math.cos(-a * o);
        return {
          path: [
            ["M", n, c],
            ["A", s, s, 0, +(a - r > 180), 1, h, f],
          ],
        };
      }),
      f
        .path()
        .attr({ "stroke-width": 10, stroke: 11, arc: 100 })
        .animate({ stroke: e, arc: r }, c, h),
      setTimeout(function () {
        100 == r && f.circle(u, u, s).attr({ "stroke-width": n, stroke: e });
      }, c),
      (f.customAttributes.txt = function (t) {
        return {
          text: Math.floor(100 * t) / 100 + "% ",
        };
      }),
      f
        .text(u, u)
        .attr({ txt: 0, fill: i, "font-size": o, "font-weight": 700 })
        .animate({ txt: r }, c);
  },
};

window.onload = function () {
  win.loopFun(
    $(".div1")[0],
    60,
    "#E6EAF0",
    "#042954",
    "#042954",
    "20px",
    20,
    60,
    1000,
    "bounce",
    "50px"
  );
};

